&quot;The Bleeding&quot; is a song by band Five Finger Death Punch. Featuring guitarist Uros Raskovski in the intro guitar solo, it is the fourth track on their album The Way of the Fist. A video for it was shot that shows the band performing along with cuts to a couple (Ivan L. Moody and actress Danielle Harris) suffering a breakdown of their relationship, while in some scenes it shows Ivan and Danielle having sex. Also, it is implied that when they broke up, Danielle committed suicide and Ivan had her ashes and was crying because he did love her, despite the fights. The single peaked at #9 on the Mainstream Rock Charts. - Wikipedia

